CREATE VIRTUAL TABLE `hanjas` USING fts3(
  `hanja` text,
  `hangul` text,
  `part_of_speech` text,
  `english` text,
  `sajasongoh` boolean
);

BEGIN;


-- Spaces cause each character to be indexed in the FTS
-- but we want the contents to have no spaces
update hanjas_content set c0hanja = replace(c0hanja, ' ', '');

COMMIT;

